import React, { useState, useEffect } from 'react';
import logo from '../assets/logo.png';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    // Check the user's authentication status (you might have your own logic here)
    const userIsLoggedIn = /* Your logic to check if the user is logged in */ true;
    setIsLoggedIn(userIsLoggedIn);
  }, []);

  return (
    <div className='nav-container'>
      <nav className="navbar">
        <div className="navbar-logo">
          <Link to='/'>
            <img src={logo} alt="Logo" />
          </Link>
        </div>
        <div className="navbar-links">
          {/* ... other navigation links */}

          <div className="navbar-link-dropdown account">
            <a className="dropbtn user-i" href='/'>
              <i className="fas fa-user"></i>
            </a>
            <div className="dropdown-content">
              <Link to='/profile'>Profile</Link>
              <Link to='/'>My Listings</Link>
              {isLoggedIn ? (
                <Link to='/logout'>Log Out</Link>
              ) : (
                <Link to='/login'>Log In</Link>
              )}
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
